import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import MenuPropDisplay from './menuPropDisplay';
import { Menu } from '@material-ui/core';

const useStyles = makeStyles({
  root: {
   width:'auto'
  },
});



class SimpleBottomNavigation extends React.Component {

state={
  value:0
}

  
  render (){
  
   

  

  let displayPanel = <div> test set variabvle</div>

   const handleMenuChange = (newMenu) =>{
     this.setState({
       value : newMenu
     })
     console.log(this.state.value);

    if (this.state.value = 1) {
      console.log("1")
     return displayPanel = (<div> right menu</div>)
    }
    else if (newMenu === 0 ) {
      displayPanel = <div> right menu</div>
    }
    else {
      displayPanel = <div> left menu</div>
    }


  }

  return (
    <div>
      {displayPanel}
 
    <BottomNavigation
     
      onChange={(event, newValue) => {
        handleMenuChange(newValue);
      
      }}
      showLabels
     
    >
      <BottomNavigationAction label="Recents" icon={<RestoreIcon />} />
      <BottomNavigationAction label="Our Mission" icon={<FavoriteIcon />} />
      <BottomNavigationAction label="Nearby" icon={<LocationOnIcon />} />
    </BottomNavigation>
    </div>
  );
}
}

export default SimpleBottomNavigation;
